import React from 'react'
import TextField from '@mui/material/TextField';
import AccountCircle from '@mui/icons-material/AccountCircle';
import InputAdornment from '@mui/material/InputAdornment';
import {styled} from '@mui/material/styles'
import Button from '@mui/material/Button';

import './style.css'

const CssTextField = styled(TextField)({
    '& label.Mui-focused': {
      color: '#01c9df',
    },
    input : {
        color:'white'
    },
    label: {
        color: 'white',
      },
    '& .MuiInput-underline:after': {
      borderBottomColor: '#a4ba96',
    },
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: 'white',
      },
      '&:hover fieldset': {
        borderColor: '#70e000',
      },
      '&.Mui-focused fieldset': {
        borderColor: '#01c9df',
      },
    },
  });
const Settings = () => {
    

    return (
        <>
            <h1>Questions</h1>
           
            <form>
                <CssTextField
                    id="username"
                    label="Username"
                    InputProps={{
                        startAdornment: (
                            <InputAdornment position="start">
                                <AccountCircle />
                            </InputAdornment>
                        ),
                    }}
                    variant="standard"
                    margin="normal"
                />

                <CssTextField
                    id="categories"
                    color="secondary"
                    select
                    label="Select a category"
                    value='name'
                    margin= 'normal'

                ></CssTextField>

                <CssTextField
                    id="difficulties"
                    color="secondary"
                    select
                    label="Select a difficulty"
                    value='difficulty'
                    margin="normal"

                ></CssTextField>

                <CssTextField
                    id="qtype"
                    color="secondary"
                    select
                    label="Select a type"
                    value='type'
                    margin="normal"
                ></CssTextField>

                <Button variant="contained" label="button">Start</Button>
            </form>
        </>
    )
};
export default Settings
